function List(props) {

    return (<ul  >
        {props.items.map(item => <li key={item.id}>
            {item.text}
            <button onClick={() => { deleteItem(item) }}><img src="./images/lixeira.jpg" alt='lixeira'></img></button>
        </li>)}
    </ul>)
}

export default List;
